import React from 'react';
import logo from './assets/logo.png';


function Header() {
  return (
    <div className="header">
      <img src={logo} alt="Make Learning Enjoyable and Interactive" />
      <h1>COLDATLESS</h1>
      <h2>Make Learning Enjoyable and Interactive</h2>
    </div>
  );
}

export default Header;
